import React from 'react'

function ProductCard(props) {
  return (
    <>
        <div>
            <img src={props.image}/>
            <p className='product-name'>{props.name}</p>
            <p className='productPrice'>{props.price}</p>
        </div>
    </>
  )
}

export default ProductCard
